INSERT INTO Animes(AnimeID, AnimeTitle, AnimeDesc, TypeID, AiredBegin, AiredEnd, Premiered, Duration, PosterUrl) VALUES (1783, CONCAT('Sora wo Kakeru Shoujo'), CONCAT('The story is set in the year 311 of the Orbital Calendar, when humanity has migrated to countless colony clusters in space. A space colony girl named Akiha Shishidou encounters a malevolent artificial intelligence named Leopard that has been installed on a colony.<br><br>Akiha is joined by an Inter-Colony Police officer named Itsuki Kannagi, a taciturn young girl named Honoka Kawai, and a robot named Imoko "Imo-chan" Shishidou.<br><br>(Source: AniDB)'), 1, '2009-01-06', '2009-06-30', 'Winter 2009', '24 min. per ep.', 'https://cdn.myanimelist.net/images/anime/6/74071.jpg');
